 ajoutés en option.     Nombre de connecteurs : Plus vous connectez de systèmes, plus vos données sont enrichies. Nos tarifs s’ajustent selon le nombre de connecteurs activés.  Nous avons conçu cette tarification pour que chaque cabinet puisse facilement accéder à une solution qui évolue avec lui et ses clients, tout en maximisant la valeur de la data.',NULL,NULL,NULL,NULL,NULL,NULL,65,448,'65|448'),(2901,NULL,NULL,'265',NULL,NULL,NULL,NULL,NULL,NULL,65,346,'65|346'),(2902,NULL,NULL,'267',NULL,NULL,NULL,NULL,NULL,NULL,65,347,'65|347'),(2903,NULL,NULL,'8 h - 18h',NULL,NULL,NULL,NULL,NULL,NULL,65,87,'65|87'),(2904,NULL,NULL,'259',NULL,NULL,NULL,NULL,NULL,NULL,65,343,'65|343'),(2905,NULL,NULL,'262',NULL,NULL,NULL,NULL,NULL,NULL,65,344,'65|344'),(2906,NULL,NULL,'263',NULL,NULL,NULL,NULL,NULL,NULL,65,345,'65|345'),(2907,NULL,NULL,'255',NULL,NULL,NULL,NULL,NULL,NULL,64,341,'64|341'),(2908,NULL,NULL,'432',NULL,NULL,NULL,NULL,NULL,NULL,64,431,'64|431'),(2909,NULL,NULL,'-',NULL,NULL,NULL,NULL,NULL,NULL,64,152,'64|152'),(2910,NULL,NULL,'Paramétrable et personnalisable - Gestion pointue des missions (lettre de mission, rôle et plan de charge) - Etats financiers',NULL,NULL,NULL,NULL,NULL,NULL,64,446,'64|446'),(2911,NULL,NULL,'270',NULL,NULL,NULL,NULL,NULL,NULL,64,348,'64|348'),(2912,NULL,NULL,'-',NULL,NULL,NULL,NULL,NULL,NULL,64,135,'64|135'),(2913,NULL,NULL,'251',NULL,NULL,NULL,NULL,NULL,NULL,64,339,'64|339'),(2914,'fr',NULL,'Partenaire de confiance en matière de gestion interne, BuroClic est votre allié incontournable pour dynamiser la productivité et l\'efficacité de votre cabinet.',NULL,NULL,NULL,NULL,NULL,NULL,64,455,'fr|64|455'),(2915,NULL,NULL,'26',NULL,NULL,NULL,NULL,NULL,NULL,64,52,'64|52'),(2916,NULL,NULL,'Open AI',NULL,NULL,NULL,NULL,NULL,NULL,64,53,'64|53'),(2917,NULL,NULL,NULL,NULL,77,NULL,NULL,NULL,NULL,64,175,'64|175'),(2918,NULL,NULL,NULL,NULL,79,NULL,NULL,NULL,NULL,64,178,'64|178'),(2919,NULL,NULL,NULL,NULL,81,NULL,NULL,NULL,NULL,64,180,'64|180'),(2920,NULL,NUL