'06 66 56 86 13','l.pimard@agrume.fr','logos/1727769408_Logo Agrume vert.png','Conçue par des avocats, la solution pour générer toutes vos procédures et documents RH !\r\n\r\nAgrume est une solution numérique pour gérer vos procédures individuelles RH, automatiser la rédaction de vos documents et gérer vos calendriers, en y intégrant automatiquement les dispositions légales et conventionnelles applicables à votre entreprise ou à vos clients. Pilotez vos ressources humaines en toute sérénité en améliorant la qualité et la sécurité de vos procédures et documents.\r\nIl est utilisé par 30 737 employeurs et a déjà traité plus de 110 666 procédures individuelles.','2024-10-01 07:56:48','2024-10-01 07:56:48',35),(8,'Oxtaam','Espace Européen - Bat. D 3 Allée Claude Debussy','Ecully','69130','https://www.oxtaam.com/','90329692900016','Coponat','Gauthier','Responsable conseil et transformation data','0783688325','gauthier.coponat@oxtaam.com','logos/1727769421_logos_oxtaam_coul-baseline-v1.png','Alimentée par un datalake pouvant se connecter à tout types de sources, Oxtaam One met la data au service du cabinet et de ses clients :\r\n- Côté cabinet: piloter son portefeuille, suivre la qualité des écritures, proposer proactivement de nouvelles missions d\'accompagnement sur mesure… Oxtaam accompagne l\'expert vers un cabinet full service\r\n- Pour les clients, Oxtaam permet d’accéder de manière massifiée a des services et autres analyses basés sur leurs données comptables et sociales.','2024-10-01 07:57:01','2024-10-01 07:57:01',118),(9,'Welyb','2 Av. des Censives','Tillé','60000','https://www.welyb.fr/','82890238700046','ZERLINI','Camille','Responsable Marketing','','c.zerlini@welyb.fr',NULL,'Welyb est un éditeur français, la société a été créée en 2017 et a rejoint le groupe ISAGRI en 2023. \r\n\r\nWelyb propose une plateforme collaborative SaaS française conçue spécifiquement pour les experts-comptables composée d\'une Gestion Électronique des Documents (GED) avancée et un portail aux couleurs du cabinet. Grâce à ses fortes interconnexions avec les outils du cabinet et de ses clients, la solution automatise un maximum de flux documentaires, leur garantissant ainsi un stockage centralisé, hébergé en France, et entièrement sécurisé. \r\n\r\nWelyb est un outil unique, qui se veut central dans le système d\'information du cabinet, offrant une plateforme intégrée qui optimise les processus, renforce la sécurité des données et soutient la croissance des cabinets d\'experts-comptables.','2024-10-01 07:59:37','2024-10-01 07:59:37',164),(10,'Cobham Solutions','11 rue Collange','LEVALLOIS','92300','https://www.cobham-solutions.fr/','479 061 046','COQUART','VERONIQUE','DIRECTRICE DES VENTES','0673720045','veronique.coquart@cobham-solutions.com','logos/1727769686_logo_CobhamSolutions.svg','Cobham Solutions, une suite de logiciels sécurisés en mode SaaS qui vérifient la conformité des politiques RH et paie des entreprises.\r\nPrès de 10 ans de conception et de développement pour bénéficier de tous les outils pour viser juste :\r\nPlusieurs milliers de points de contrôle ; la lecture automatisée des bulletins de salaire et des DSN et une base de données légale et conventionnelle toujours à jour\r\nL’analyse de pratiques, la confrontation à la réglementation et la mise en conformité\r\nL’amélioration continue de l’exactitude de vos process RH (en évitant les redressements)','2024-10-01 08:01:26','2024-10-01 08:01:26',55),(11,'Silae','1330, Avenue de la Lauzière – Europarc de Pichaury','AIX EN PROVENCE','13290','https://www.silae.fr/','523020287','Lecaille','Lola','Chargée de communication','06 23 47 32 53','lola.lecaille@silae.fr',NULL,'Silae est leader des solutions de paie et propose le SIRH le plus intégré du marché. Silae révolutionne la paie grâce à sa solution SaaS hébergée sur le Cloud avec des mises à jour automatiques du légal et du conventionnel et simplifie le quotidien des RH en leur permettant de se concentrer sur leur cœur de métier. Distribuée par plus de 5 500 partenaires, l’entreprise génère plus de 7 millions de bulletins de paie par mois pour plus de 950 000 entreprises en France.','2024-10-01 08:03:30','2024-10-01 08:03:30',142),(12,'KWIPER','49 rue de la république','LYON','69002','https://www.kwiper.fr/','889109823','DELAVENNE','Thibaut','Directeur Général','0788141935','thibaut@kwiper.fr','logos/1727769982_k fact.png','kwiper est un logiciel SaaS, à destination des professionnels du conseil patrimonial. \r\nNous offrons une solution complète pour délivrer de manière industrialisée une approche personnalisée du conseil patrimonial. \r\nEn conjuguant technologie, pédagogie, design et expertise en ingénierie patrimoniale, kwiper permet aux professionnels de délivrer des documents patrimoniaux en marque blanche, maximisant la valeur ajoutée pour leurs client finaux.\r\nkwiper, c\'est votre ingénieur patrimonial digital !','2024-10-01 08:06:22','2024-10-01 08:06:22',94),(13,'LOMAN SAS / BUROCLIC','456 Chemin de Carimaï','MOUGINS','06250','www.buroclic.com','418927752','MANDINE','Sandra','Directrice Marketing','0493948989','sandra@buroclic.com','logos/1727770384_BUROCLIC.png','BuroClic est une entreprise française située à Mougins, spécialisée dans le développement de logiciels de gestion de dossiers depuis plus de 25 ans. BuroClic se distingue par ses solutions innovantes et personnalisées, conçues spécifiquement pour les professionnels du chiffre (experts-comptables, commissaires aux comptes), du droit (avocats), et les entreprises de services.\r\nNotre engagement envers l\'excellence, la satisfaction client et le développement constant de nos produits fait de nous un acteur de référence dans notre domaine.','2024-10-01 08:13:04','2024-10-01 08:13:04',47),(14,'Lefebvre Dalloz','10 PLACE DES VOSGES 92072','La Défense Cedex','92072','https://www.lefebvre-dalloz.fr/','509620290','de Maquillé','Renaud','Responsable Evenementiel','0633430415','r.demaquille@lefebvre-dalloz.fr','logos/1727771052_Logo-1ligne-BL_bleu.png','Lefebvre Dalloz est le leader de la connaissance juridique et fiscale en France. La marque porte une offre globale d’édition, de formation et, de logiciels et services, comprenant notamment les marques historiques Dalloz, Editions Francis Lefebvre et Editions Législatives. Grâce à la combinaison de ses savoir-faire, Lefebvre Dalloz apporte une réponse globale aux entreprises (DRH, DAF, directeurs juridiques, conformité), au secteur public, aux professions réglementées (notaires, experts comptables, avocats…) et aux étudiants. Lefebvre Dalloz est une marque du groupe européen Lefebvre Sarrut qui a réalisé un chiffre d’affaires de 555 millions d’€ en 2023 et compte 2500 collaborateurs. Sa raison d’être est d’activer la connaissance pour une société plus juste, efficace et durable.','2024-10-01 08:24:12','2024-10-01 08:24:12',97),(15,'TEOGEST','4 rue des Carmes','NANCY','54100','www.teogest.com','752955237','QUINTARD','STEPHANIE','Chargée de marketing et Communication','0620779269','stephanie.quintard@teogest.com','logos/1727771342_Logo_Teogest_RVB.png','Teogest : Une solution intégrée pour les cabinets comptables\r\n\r\nTeogest est le fruit de douze années de développement, offrant aux cabinets d\'expertise comptable des outils combinant compétences métier et technologies avancées, facilitant ainsi leur transition numérique à un rythme adapté.\r\n\r\n100 % détenue par des actionnaires français, Teogest garantit son indépendance et sert des dizaines de milliers d\'utilisateurs dans 14 pays.\r\n\r\nTeogest Expert est une solution collaborative regroupant précompta, production comptable, portail clients et gestion interne. Ses nombreuses fonctionnalités (tableaux de bord, GED, OCR, etc.) sont intégrées pour limiter les coûts et optimiser les performances. Des connecteurs, comme jedeclare.com et Chorus Pro, facilitent l\'interopérabilité. Une équipe de maintenance dédiée et des packs sur-mesure simplifient la collaboration entre experts-comptables et clients.','2024-10-01 08:29:02','2024-10-01 08:29:02',152),(16,'Septeo Solutions Experts-Comptables (Ingeneo)','56 rue blaise pascal','Vitrolles','13127','www.ingeneo.eu','533951687','Battentier','Meryl','Responsable marketing','06 49 26 03 01','meryl.battentier@septeo.com','logos/1727772343_logo-Septeo-Solutions-Experts-Comptables-RGB_horiz-blue-orange (1).png','Ingeneo booste la productivité des experts-comptables tout en offrant une vision claire et précise des indicateurs de pilotage. Notre ambition : transformer les experts-comptables en conseillers de référence, pour un pilotage de performance à la fois fiable et pertinent.\r\n\r\n✔️ Développez votre expertise\r\n\r\n✔️ Soyez conforme avec la facturation électronique\r\n✔️ Gagnez du temps pour offrir des conseils clairs et avisés\r\n✔️ Assurez-vous une tenue comptable sans faille et sans effort','2024-10-01 08:45:43','2024-10-01 08:47:23',138),(17,'MyCompanyFiles','11 bis rue jouvencel','Versailles','78000','www.mycompanyfiles.fr','537687659','','','','','jean-blaise@mycompanyfiles.fr','logos/1727772675_Logo MCF - CMJN.png','MyCompanyFiles a créé la plateforme d\'échanges sécurisée pour partager simplement documents et informations entre les entreprises et leurs clients.\r\n\r\nLa solution s\'adresse aux organisations et professions devant gérer des flux importants d\'échanges documentaires et de fichiers, en conformité avec le RGPD. \r\n\r\nPour les experts-comptables et CAC, la plateforme devient la porte d\'entrée digitale du cabinet, interconnectée avec tous les outils métier. En un seul endroit, sur smartphone, tablette, et ordinateur, les clients retrouvent toute l\'information que vous souhaitez échanger (bulletins de paie, liasses fiscales, ...) ainsi que l’accès à tous les outils logiciels développés par les éditeurs de production comptable, de paie, de signature électronique etc...\r\n\r\nPlusieurs fois récompensée, MyCompanyFiles agit comme « l’ostéopathe de la relation client » et efface les douleurs liées à la collecte et la restitution de documents.\r\n\r\nLa société a rejoint en Mai 2024 le groupe Visma.','2024-10-01 08:50:51','2024-10-01 08:51:15',107),(18,'COMPTASECURE','21 Rue Bergère','PARIS','75009','https://www.comptasecure.fr/','980455398','','','','','contact@comptasecure.fr','logos/1727773816_Logo horizontal ComptaSecure.png','ComptaSecure, plateforme d\'Intelligence Comptable dédiée aux professionnels du chiffre, exploite le Fichier des Écritures Comptables (FEC) pour optimiser les méthodes comptables, sécuriser la fiscalité et les ressources financières, ainsi que guider les décisions et investissements des entreprises. Conformexpert.com, la solution d’ECF proposée par ECMA, s’appuie également sur cette technologie pour son module d’analyse du FEC.\r\n\r\nEn novembre 2023, ComptaSecure lance Luca, le premier assistant basé sur l’IA générative conversationnelle qui facilite et fiabilise les connaissances comptables et fiscales. Plus de 2 000 professionnels de la comptabilité utilisent déjà ComptaSecure pour sécuriser leurs processus, leur fiscalité, et leurs finances.','2024-10-01 09:10:16','2024-10-01 09:10:16',57),(19,'WEEKERA','442, Georges Besse','Nîmes','30000','https://weekera.fr','909571754','Longueville','Rémy','CEO','06 22 03 00 30','r.longueville@weekera.fr','logos/1727775057_Weekera_Extended_K_RGB.jpg','Weekera la nouvelle solution intelligente de paie et RH à destination des experts-comptables','2024-10-01 09:30:57','2024-10-01 09:30:57',163),(20,'BUSINESS CARD ASSOCIATES (BCA)','75, rue du général Leclerc','Bois Colombes','92270','https://www.bcasmart.com','487929572','CIANCHI','Christophe','Président','0156050669','ccianchi@bcasmart.com','logos/1727775342_logo BCA.png','Revendeur et Intégrateur français de solutions d’identité numérique et protection des données depuis 2006, Business Card Associates (BCA) a développé un produit 100% français, la clé DoKey. Cette clé qui intègre une carte à puce supportant votre identité numérique, vous permet de réaliser une signature qualifiée en environnement fixe (laptop) ou mobile (smartphones et tablettes).','2024-10-01 09:35:42','2024-10-01 09:35:42',48),(21,'BETURBO','143 Boulevard René Cassin','NICE','06200','www.beturbo.fr','952607570','PASTUR','Vincent','Co-founder','0684663097','vincent.pastur@beturbo.fr','logos/1727776934_BeTurbo_LogoLD.jpg','BeTurbo est une start-up fondée par deux amis aux profils complémentaires : expertise informatique pour l\'un et ingénierie financière et comptable pour l\'autre.\r\nNous proposons une solution de Business Intelligence moderne et dynamique pour simplifier le quotidien des décideurs et de leurs conseils.','2024-10-01 10:02:14','2024-10-01 10:02:14',43),(22,'Forekasts','4 rue du fer à moulin','Paris','75005','forekasts.fr','887498996','Renai','Djamila','Chargée de communication marketing','','djamila@forekasts.fr','logos/1727777731_Logo Forekasts carré Bleu clair – blanc.svg','','2024-10-01 10:15:31','2024-10-01 10:15:31',76),(23,'NETexcom','6 bd des moulins','','','www.NETexcom.com','02 S 04059','Mathio','Yannick','CEO','06 40 61 92 69','contact@netexcom.com','logos/1727778420_netexcom.png','NETexcom propose depuis 2002 aux Experts Comptables et à leurs clients des solutions de gestion et de communication innovantes. 20 ans de collaboration avec la Profession Comptable en proposant une solution de production avec OCR , Import automatique des banques, Liasses, révisions… dans un environnement TOUT INTEGREE ! Plateforme collaborative pour les clients avec tableau de bord, Ges Comm... 35 cabinets comptables à notre Capital afin de resserrer nos liens avec la Profession Comptable !','2024-10-01 10:27:00','2024-10-01 10:27:00',111),(24,'Sekost','4 Rue Ampère','Lannion','22300','https://sekost.fr/','907610364','Richer','Samuel','Directeur Commercial','06.84.87.94.39','samuel.richer@sekost.fr','logos/1727782982_logo_baseline_partenaire_dégradé (1).png','','2024-10-01 11:43:02','2024-10-01 11:43:02',134),(25,'CNOEC',